import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';


class Nav1 extends React.Component {
	render(){
		
		return(
			<Nav className="navbar navbar-expand-lg navbar-dark ftco_navbar bg-dark ftco-navbar-light">
				<Container>
					<Nav.Item >
						<Nav.Link className="navbar-brand">Komerz.io</Nav.Link>
					</Nav.Item>
					<Nav className="navbar-toggler">
						<Nav.Link><span className="oi oi-menu"></span></Nav.Link>
						<DropdownButton id="dropdown-basic-button" title="MENU" bg-dark >
  							<Dropdown.Item className="dropdown nav-item" href="#">Iniciar Sesion</Dropdown.Item>
  							<Dropdown.Item className="dropdown nav-item" href="#/">Registrarse</Dropdown.Item>
						</DropdownButton>
	      			</Nav>
					<div className="collapse navbar-collapse">
						<ul className = "navbar-nav ml-auto">
							<li className="nav-item cta">
								<Nav.Link className="nav-link icon d-flex align-items-center">
									<i className="ion-ios-cloud-download mr-2"></i> 
									INICIAR SESION
								</Nav.Link>
							</li>
							<li className="nav-item cta">
								<Nav.Link className="nav-link icon d-flex align-items-center">
									<i className="ion-ios-cloud-download mr-2"></i> 
									REGISTRARSE
								</Nav.Link>
							</li>

						</ul>
					</div>
				</Container>
			</Nav>
		)

	}
}
export default Nav1;
